import styled, { css } from 'styled-components';
import mole from "./../core/Mole";
import useMovePage from "../hooks/useMovePage";
import SelectList from "../comp/module/SelectList";



const Ready = () => {
    const [setPage] = useMovePage();

    return (
        <Container>
            <SelectList type="row" list={mole.list.rowColumn}/>
            <SelectList type="column" list={mole.list.rowColumn}/>
            <SelectList type="count" list={mole.list.count()}/>
            <Button onClick={() => (setPage('game'))}>시작</Button>
        </Container>
    )
}

const Container = styled.div`
    width: 100%;
    height: 100vh;
    background-color: #bdc3c7;
`;

const Button = styled.button`
    display: inline-flex;
    align-items: center;
    outline: none;
    border: none;
    border-radius: 4px;
    color: white;
    font-weight: bold;
    cursor: pointer;
    padding-left: 1rem;
    padding-right: 1rem;
    height: 5.25rem;
    width: 5.8rem;
    font-size: 2rem;
    background: #228be6;
    &:hover{
        background: #339af0;
    }
    &:active{
        background: #1c7ed6;
    }
    & + & {
        margin-left: 1rem;
    }
`;

export default Ready;
